import React from 'react'
import Nav from './Nav'

const Home = () => {
  return (
    <>
      <div style={{ width: '100vw', height: '100vh', display: 'flex', background: '#FF9F66', flexDirection: 'row' }}>

        {/* First div (left side) containing Nav */}
        <div style={{ width: '30vw', height: '100vh', background: 'navy', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
          <Nav />
        </div>

        {/* Second div (right side) */}
        <div style={{ width: '70vw', height: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center', background: '#FF9F66' }}>
          home
        </div>
      </div>
    </>
  )
}

export default Home
